function shuffleArray(arr) {
  for (let i = arr.length - 1; i > 0; i--) {
    const j = Math.floor(Math.random() * (i + 1));
    [arr[i], arr[j]] = [arr[j], arr[i]];
  }
  return arr;
}

function shuffleQuestions(set = []) {

  const shuffled = set.map(q => {
    const paired = q.options.map((opt, i) => ({ opt, w: q.weights[i] }));
    shuffleArray(paired);
    return {
      ...q,
      options: paired.map(p => p.opt),
      weights: paired.map(p => p.w)
    };
  });
  return shuffleArray(shuffled);
}






