function loadQuestions() {
  const category = localStorage.getItem("selectedCategory");
  if (!category) return showError();

  const bank = localQuestionBank[category] || [];
  if (!bank.length) return showError();


  const bankCopy = [...bank];
  shuffleArray(bankCopy);       
  const sampled = bankCopy.slice(0, 10);


  questions = shuffleQuestions(sampled);

  if (!questions.length) return showError();

  renderQuestion(true);
}


console.log("Questions loaded:", questions.length, "Category:", category);


/* ========== Error Handler ========== */
function showError() {
  questionBody.innerHTML = "<p style='color:#fff;text-align:center'>Unable to load questions. Please try again.</p>";
  nextBtn.disabled = true;
  prevBtn.disabled = true;
}


function fadeRender(content) {
  questionBody.style.opacity = 0;
  setTimeout(() => {
    questionBody.innerHTML = content;
    questionBody.style.opacity = 1;
  }, 250);
}

function renderQuestion(instant = false) {

  const q = questions[currentIndex];
  if (!q) return;

  questionNumber.textContent = currentIndex + 1;
  progressFill.style.width = ((currentIndex + 1) / questions.length) * 100 + "%";

  const optionsHTML = q.options
    .map(opt => {
      const selected = answers[currentIndex] === opt ? "selected" : "";
      return `<button type="button" class="option-btn ${selected}" data-value="${opt}">${opt}</button>`;
    })
    .join("");

  const html = `<h2>${q.text}</h2><div class="options">${optionsHTML}</div>`;
  instant ? (questionBody.innerHTML = html) : fadeRender(html);

  setTimeout(() => {
    document.querySelectorAll(".option-btn").forEach(btn => {
      btn.addEventListener("click", () => {
        answers[currentIndex] = btn.dataset.value;
        document.querySelectorAll(".option-btn").forEach(b => b.classList.remove("selected"));
        btn.classList.add("selected");
      });
    });
  }, 300);

  prevBtn.disabled = currentIndex === 0;
  nextBtn.innerHTML = `${currentIndex === questions.length -1 ? "Submit" : "Next"} <img src="media/nextwhite.png" alt="Next" class="nav-icon" />`;
}


nextBtn.addEventListener("click", () => {
  if (!answers[currentIndex]) {
    questionBody.animate([{ transform: "translateX(0)" }, { transform: "translateX(-6px)" }, { transform: "translateX(6px)" }, { transform: "translateX(0)" }], {
      duration: 300,
      easing: "ease-in-out"
    });
    return;
  }

  if (currentIndex < questions.length -1) {
    currentIndex++;
    renderQuestion();
  } else {
    submitAnswers();
  }
});

prevBtn.addEventListener("click", () => {
  if (currentIndex > 0) {
    currentIndex--;
    renderQuestion();
  }
});

/* ========== Tooltip ========== */
infoBtn.addEventListener("mouseenter", showTooltip);
infoBtn.addEventListener("focus", showTooltip);
infoBtn.addEventListener("mouseleave", hideTooltip);
infoBtn.addEventListener("blur", hideTooltip);

function showTooltip() {
  tooltip.textContent = "Answer honestly -results generate a personalized roadmap.";
  tooltip.style.display = "block";
  const rect = infoBtn.geCompanyundingClientRect();
  tooltip.style.left = rect.left + window.scrollX -8 + "px";
  tooltip.style.top = rect.top + window.scrollY -tooltip.offsetHeight -12 + "px";
  tooltip.style.opacity = 1;
}
function hideTooltip() {
  tooltip.style.opacity = 0;
  setTimeout(() => (tooltip.style.display = "none"), 200);
}

function submitAnswers() {
  if (answers.length !== questions.length) {
    alert("Please answer all questions before submitting.");
    return;
  }

  // Group scores by axis
  const axisScores = {};
  const axisCounts = {};

  questions.forEach((q, i) => {
    const selected = q.options.indexOf(answers[i]);
    const weight = q.weights[selected];

    if (!axisScores[q.axis]) {
      axisScores[q.axis] = 0;
      axisCounts[q.axis] = 0;
    }

    axisScores[q.axis] += weight;
    axisCounts[q.axis] += 1;
  });


  const radarData = {};
  Object.keys(axisScores).forEach(axis => {
    const avgWeight = axisScores[axis] / axisCounts[axis];
radarData[axis] = Math.min(100, Math.max(0, (avgWeight - 0.5) * 22));
  });

  // Overall score
  const score =
    Object.values(radarData).reduce((a, b) => a + b, 0) /
    Object.values(radarData).length;

  (async () => {
  await showResults(); 
  showResult(score, radarData); 
})();

}

async function showResults() {
  const resultsLoader = document.getElementById('results-loader');
  const resultsSection = document.getElementById('results-section');


  if (resultsLoader) {
    resultsLoader.classList.remove('hidden');
  }

  await new Promise(resolve => setTimeout(resolve, 1500));


  if (resultsLoader) {
    resultsLoader.style.opacity = '0';
    setTimeout(() => {
      resultsLoader.classList.add('hidden');
      resultsLoader.style.opacity = '1';
      if (resultsSection) resultsSection.style.display = 'block';
    }, 600);
  } else if (resultsSection) {
    resultsSection.style.display = 'block';
  }
}



