function getTopCompanySolutions(radarData, threshold = 60) {
  const lowAxes = Object.entries(radarData)
    .filter(([_, val]) => val < threshold)
    .map(([axis]) => axis);

  if (!lowAxes.length) return [];


  const allQs = Object.values(localQuestionBank).flat();
  const matchedSolutions = [];

  allQs.forEach(q => {
    if (lowAxes.includes(q.axis) && Array.isArray(q.recommended)) {
      matchedSolutions.push(...q.recommended);
    }
  });


  const freq = matchedSolutions.reduce((acc, sol) => {
    acc[sol] = (acc[sol] || 0) + 1;
    return acc;
  }, {});


  return Object.entries(freq)
    .sort((a, b) => b[1] - a[1])
    .slice(0, 3)
    .map(([slug]) => ({
      slug,
      ...(Company_SOLUTION_MAP[slug] || { title: slug, desc: "", url: "#" })
    }));
}


