function getDetailedBreakdown(category, subScores = []) {

  if (!Array.isArray(subScores) || subScores.length === 0) {
    return "Data unavailable for this category.";
  }

  // Average score (rounded to 1dp)
  const avg = subScores.reduce((a, b) => a + b, 0) / subScores.length;
  const avgScore = avg.toFixed(1);

  const text = {
    technology: `Your technology performance averages ${avgScore}/100 across integration, scalability, and innovation. 
You show solid progress in adopting modern systems but may lack depth in automation, cybersecurity resilience, and proactive innovation pipelines. 
We recommend reviewing system architecture and leveraging APIs or middleware to enhance interoperability.`,
    
    process: `Your process maturity averages ${avgScore}/100, reflecting partial standardization and automation. 
To fully optimize efficiency, strengthen documentation frameworks and introduce consistent performance metrics. 
Improved cross-department communication and digital workflow monitoring will raise process transparency.`,
    
    customer: `Customer relationship indicators average ${avgScore}/100, suggesting fair engagement but missed opportunities in loyalty and feedback utilization. 
Enhancing personalization and creating automated retention campaigns can strengthen satisfaction and reduce churn.`,
    
    people: `People enablement scores average ${avgScore}/100, showing healthy collaboration and leadership, but growth potential remains. 
We suggest formal upskilling frameworks and peer mentorship systems to encourage innovation, recognition, and long-term retention.`
  };

  return text[category] || `Performance breakdown (avg ${avgScore}/100) shows mixed results across all areas.`;
}






