function randomNear(base) {
  const variance = Math.floor(Math.random() * 16) -8;
  return Math.max(30, Math.min(100, base + variance));
}

function capitalize(s) {
    if (!s || typeof s !== 'string' || s.length === 0) {
        return '';
    }
    return s.charAt(0).toUpperCase() + s.slice(1);
}
