// --- LOADER FIX ---
const loader = document.getElementById('loading-screen');
if (loader) {
  const MIN_DISPLAY_TIME = 2000; 
  const FADE_DURATION = 900;    
  const REMOVE_DELAY = 300;      
  const startTime = Date.now();

  window.addEventListener('load', () => {
    const elapsed = Date.now() - startTime;
    const remaining = Math.max(0, MIN_DISPLAY_TIME - elapsed);

    setTimeout(() => {
      loader.style.transition = `opacity ${FADE_DURATION / 1000}s ease`;
      loader.style.opacity = '0';
      setTimeout(() => loader.remove(), REMOVE_DELAY);
    }, remaining);
  });
}



/**
 * Saves the completed assessment summary to localStorage.
 * @param {string} category 
 * @param {number} score 
 */
function saveAssessmentHistory(category, score) {
  try {
    const history = JSON.parse(localStorage.getItem('Company_assessment_history') || '[]');
    history.unshift({
      category: category || 'unknown',
      score: Math.round(score * 10) / 10,
      date: new Date().toLocaleString()
    });
    localStorage.setItem('Company_assessment_history', JSON.stringify(history));
    console.log('âœ… Assessment history saved:', history[0]);
  } catch (err) {
    console.error('âŒ Failed to save assessment history', err);
  }
}


